    this._range = range;
  }

  set range(value) {
    if (typeof value === "number" && value > 0) {
      this._range = value;
    }
  }

  get range() {
    return this._range;
  }

  cloneCar() {
    const { brand, motor, color } = this;
    return new car(brand, motor, color);
  }
}
